import React from 'react';
import Card from '../Card';

const ArrayCard: React.FC = () => {
    const arrayFunctions = [
        { name: 'map', description: 'Creates a new array with the results of calling a provided function on every element in the calling array.' },
        { name: 'filter', description: 'Creates a new array with all elements that pass the test implemented by the provided function.' },
        { name: 'reduce', description: 'Executes a reducer function on each element of the array, resulting in a single output value.' },
        { name: 'forEach', description: 'Executes a provided function once for each array element.' },
        { name: 'find', description: 'Returns the value of the first element in the array that satisfies the provided testing function.' },
    ];

    return (
        <Card title="Array Functions" content={
            <ul>
                {arrayFunctions.map((func, index) => (
                    <li key={index}>
                        <strong>{func.name}:</strong> {func.description}
                    </li>
                ))}
            </ul>
        } />
    );
};

export default ArrayCard;
